package com.yaoli.ajob;


import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 * Created by will on 2017/2/10.
 */
public class _438_FindAllAnagramsinaString {
    public static void main(String[] args) {
        String str = "";
        String p  = "";
        findAnagrams(str,p);
    }


    public static  List<Integer> findAnagrams(String s, String p) {
        List<Integer> list = new ArrayList<Integer>();

        // 模式类
        Map<Character,Integer> mapp = new HashMap<Character,Integer>();

        char[] pc = p.toCharArray();

        for(char c : pc){
            if(mapp.containsKey(c)){
                mapp.put(c,mapp.get(c)+1);
            }else{
                mapp.put(c,1);
            }
        }

        // 字符串类
        char [] ss = s.toCharArray();

        if(ss.length == 0){
            return list;
        }

        if(pc.length > ss.length){
            return list;
        }

        Map<Character,Integer> maps = new HashMap<Character,Integer>();
        for(int i = 0 ; i < pc.length ; i++){
            if(maps.containsKey(ss[i])){
                maps.put(ss[i],maps.get(ss[i])+1);
            }else{
                maps.put(ss[i],1);
            }
        }

        boolean flag = true;


        for(Character c : mapp.keySet()){
            if(maps.get(c) == null){
                flag = false;
                break;
            }
            if(!mapp.get(c).equals(maps.get(c))){
                flag = false;
                break;
            }
        }

        if(flag == true){
            list.add(0);
        }

        //在ss中 以 pc.length 为起点
        for(int i = pc.length ; i < ss.length ;i++){
            if(i == ss.length - 1){
                System.out.println();
            }
            if(judge(ss[i - pc.length],ss[i],mapp,maps) == true){
                list.add(i - pc.length + 1);
            }

        }

        return list;
    }

    // a 表示 前面的，b表示 要验证的
    public static boolean judge(char a,char b,Map<Character,Integer> mapp,Map<Character,Integer> maps){
        boolean result = true;

        if(maps.get(a) == 1){
            maps.remove(a);
        }else{
            maps.put(a,maps.get(a) - 1 );
        }

        if(maps.containsKey(b)){
            maps.put(b,maps.get(b) + 1);
        }else{
            maps.put(b,1);
        }

        for(Character c : mapp.keySet()){
            if(maps.get(c) == null){
                return false;
            }
            if(!mapp.get(c).equals(maps.get(c))){
                return false;
            }

        }

        return result;
    }
}
